import {User} from '../types'
import httpClient from '../httpClient'


export const Shop: React.FC = () => {

  const [user, setUser] = useState<User | null>(null)
useEffect(() => {
  (async () => {
    try{
      const rep = await httpClient.get("//localhost:5000/@me")
      setUser(resp.data)
    } catch(error){
      console.log("Unauthorized");
    }


  })();
});

  return (
    <div>
      <Banner/>
      <Trending/>
    </div>
  )
}
export default Shop
